original:
Deal damage to enemies within a fan-shaped range (5-grid radius) in front of you;
If not breaking defense: additionally inflict 10 points of Bleeding on the enemy;
   If breaking defense: additionally inflict 10% of the enemy's maximum HP in damage, and inflict 20 points of Bleeding.

Deal damage to enemies within a 3-grid radius of yourself and knock them back 2 grids;
If not breaking defense: 35% chance to trigger Stagger, Disassembly, Slowed, Broken bone on the enemy;
   If breaking defense: additionally inflict 15% of the enemy's maximum HP in damage, and trigger Stagger, Disassembly, Slowed, Broken bone on the enemy;

Deal damage to enemies within a fan-shaped range (5-grid radius) in front of you;
If not breaking defense: no additional effects;
   If breaking defense: additionally inflict 10% of the enemy's maximum HP in damage, 50% chance to trigger Vulnerable effect.

Deal damage to enemies within a fan-shaped range (4-grid radius) in front of you;
If not breaking defense: additionally inflict 10 points of Blinded on the enemy;
   If breaking defense: additionally inflict 5% of the enemy's maximum HP in damage, and inflict 20 points of Blinded.

Deal damage to enemies within a 5-grid radius and 1-grid radius around yourself;
If not breaking defense: additionally inflict 10 points of Bleeding on the enemy;
   If breaking defense: additionally inflict 10% of the enemy's maximum HP in damage, and inflict 20 points of Bleeding.

Deal damage to enemies within a 6x3 range in front of you and knock them back 1 grid;
If not breaking defense: additionally reduce the enemy's Qi by 125 points;
   If breaking defense: additionally inflict 15% of the enemy's maximum HP in damage, and reduce the enemy's Qi by 250 points.

Inflicts damage on enemies within a radius of 3 squares around oneself and knocks them back 1 square;
Without breaking defense: additionally inflicts 20 points of Internal Injury on the enemy;
   Breaking defense: additionally inflicts 15% of the enemy's maximum HP in damage, and inflicts 40 points of Internal Injury, increases own Critical by 15% (lasts for 2 actions).

Inflicts damage on enemies within a radius of 4 squares around oneself;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 20% of the enemy's maximum HP in damage, for every 3 points higher own Sword is than the enemy's Sword, inflicts 1 point of Bleeding on them.

Inflicts damage on enemies within a fan-shaped range (radius of 5 squares) in front of oneself;
Without breaking defense: 35% chance to trigger Confuse effect on the enemy;
   Breaking defense: additionally inflicts 15% of the enemy's maximum HP in damage, and triggers Confuse effect; when Propriety is above 50, for every point above, reduces enemy's energy by 5 points.

Inflicts damage on enemies within a radius of 3 squares around oneself and knocks them back 3 squares;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 10% of the enemy's maximum HP in damage, and prevents them from moving in their next action.

Inflicts damage on enemies within a radius of 3 squares around oneself;
Without breaking defense: 35% chance to trigger Charm effect on the enemy (lasts for 2 actions);
   Breaking defense: additionally inflicts 20% of the enemy's maximum HP in damage, 75% chance to trigger Charm effect on the enemy (lasts for 2 actions).

Inflicts damage on enemies within a 5x1 range in front of oneself;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 5% of the enemy's maximum HP in damage, for every 10 points higher own Throwing is than the enemy's Throwing, inflicts 1 point of Bleeding on them.

Inflicts damage on enemies within a fan-shaped range (radius of 4 squares) in front of oneself;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 10% of the enemy's maximum HP in damage, for every 7 points higher own Throwing is than the enemy's Throwing, inflicts 1 point of Bleeding on them.

Inflicts damage on enemies within a radius of 4 squares around oneself;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 15% of the enemy's maximum HP in damage, for every 5 points higher own Throwing is than the enemy's Throwing, inflicts 1 point of Bleeding on them.

Deal damage to enemies within a fan-shaped range (4-grid radius) in front of you;
If not breaking defense: additionally inflict 10 points of Blinded on the enemy;
   If breaking defense: additionally inflict 5% of the enemy's maximum HP in damage, and inflict 20 points of Blinded.

Inflicts damage on enemies within a radius of 4 squares around oneself;
Without breaking defense: 25% chance to trigger Vulnerable effect on the enemy (lasts for 1 action);
   Breaking defense: additionally inflicts 10% of the enemy's maximum HP in damage, 50% chance to trigger Vulnerable effect on the enemy (lasts for 1 action).

Inflicts damage on enemies within a range of 1 square in front of oneself;
Without breaking defense: no additional effects;
   Breaking defense: additionally inflicts 5% of the enemy's maximum HP in damage, 50% chance to trigger Charm effect on the enemy (lasts for 1 action).

Inflicts damage on enemies within a fan-shaped range (radius of 4 squares) in front of oneself;
Without breaking defense: additionally inflicts 10 points of Poisoned on the enemy;
   Breaking defense: additionally inflicts 10% of the enemy's maximum HP in damage, and inflicts 20 points of Poisoned, reduces enemy's current MP by 10%.

Inflict damage on enemies within a 4-tile radius of yourself;
Without breaking defense: additionally reduce enemy Action Speed by 10%, Critical, Parry, Evasion by 5% (lasts for 2 actions);
   With breaking defense: additionally reduce enemy Action Speed by 20%, Critical, Parry, Evasion by 10% (lasts for 2 actions).

Inflict damage on enemies within a 3-tile horizontal range in front of you;
Without breaking defense: additionally inflict 10 points of Blinded on the enemy;
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, and inflict 20 points of Blinded.

Inflict damage on enemies within a 5x1 range in front of you;
Without breaking defense: no additional effects;
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, for every 7 points your Throwing is higher than the enemy's, inflict 1 point of Internal Injury.

Inflict damage on enemies within a 1-tile range in front of you;
Without breaking defense: 25% chance to trigger Unconscious effect on the enemy (lasts for 1 action);
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, 50% chance to trigger Unconscious effect on the enemy (lasts for 1 action).

Inflict damage on enemies within a 5x1 range in front of you;
Without breaking defense: additionally inflict 10 points of Bleeding on the enemy;
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, and inflict 20 points of Bleeding.

Inflict damage on enemies within a fan-shaped range (4-tile radius) in front of you;
Without breaking defense: additionally inflict 10 points of Internal Injury on the enemy;
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, and inflict 20 points of Internal Injury.

Inflict damage on enemies within a 3-tile radius of yourself and knock them back 1 tile;
Without breaking defense: 35% chance to trigger Broken bone effect on the enemy (lasts for 2 actions);
   With breaking defense: additionally inflict damage equal to 15% of the enemy's maximum HP, and trigger Broken bone effect on the enemy (lasts for 2 actions).

Inflict damage on enemies within a 7x3 range in front of you;
Without breaking defense: no additional effects;
   With breaking defense: additionally inflict damage equal to 15% of the enemy's maximum HP, for every 5 points your Long is higher than the enemy's, inflict 1 point of Sealed.

Inflict damage on enemies within a 6x3 range in front of you;
Without breaking defense: no additional effects;
   With breaking defense: additionally inflict damage equal to 15% of the enemy's maximum HP, for every 5 points your Sword is higher than the enemy's, inflict 1 point of Bleeding.

Inflict the following effects on enemies within a radius of 5 squares of yourself;
Unbroken Defense: Trigger Stagger, Disassemble, Slowed, Broken Bone on the enemy;
Broken Defense: For every additional 100MP of your current MP, inflict an additional 1% damage on the enemy, up to 35%; and trigger Stagger, Disassemble, Slowed, Broken Bone on them, after triggering, your MP Cost is emptied, then recover 10% of your maximum MP value with each action (lasts for 3 actions).

Inflict damage on enemies within a 4-tile radius of yourself;
Without breaking defense: additionally inflict 10 points of Bleeding on the enemy, and reduce 100 points of their Qi;
   With breaking defense: additionally inflict damage equal to 10% of the enemy's maximum HP, and inflict 20 points of Bleeding, reduce 175 points of their Qi.

Inflict damage on enemies within a 4x1 range in front and knock them back 1 square;
No defense break: No additional effects;
   Defense break: Inflict an additional 10% of the enemy's max HP as damage.

Inflict damage on enemies within a 6x3 range in front;
No defense break: 35% chance to trigger either Confuse, Cut tendon, or Vulnerable effect on the enemy;
   Defense break: Inflict an additional 20% of the enemy's max HP as damage, and trigger Confuse, Cut tendon, Vulnerable effects on them; for every 3 points your Sword is higher than the enemy's, inflict 1 point of Bleeding.

Inflict damage on enemies within a 3-square radius of yourself;
No defense break: 35% chance to trigger Charm effect on the enemy (lasts for 1 action);
   Defense break: Inflict an additional 15% of the enemy's max HP as damage, and 75% chance to trigger Charm effect on the enemy (lasts for 1 action).

Inflict damage on enemies within a 5x5 range in front;
No defense break: Inflict an additional 15 points of Internal Injury, 15 points of Sealed, 15 points of Blinded on the enemy;
   Defense break: Inflict an additional 15% of the enemy's max HP as damage, and inflict 30 points of Internal Injury, 30 points of Sealed, 30 points of Blinded on them.

Inflict damage on enemies within a 5-square radius of yourself;
No defense break: 35% chance to trigger either Internal break, Broken bone, or Vulnerable effect on the enemy (lasts for 2 actions);
   Defense break: Inflict an additional 20% of the enemy's max HP as damage, and trigger Internal break, Broken bone, Vulnerable effects on them (lasts for 2 actions).

Inflict damage on enemies within a 7x3 range in front;
No defense break: 25% chance to trigger Vulnerable effect on the enemy (lasts for 1 action);
   Defense break: Inflict an additional 10% of the enemy's max HP as damage, and 50% chance to trigger Vulnerable effect on the enemy (lasts for 1 action).

Inflict damage on enemies within a 2-square radius of yourself;
No defense break: Inflict an additional 10 points of Bleeding on the enemy;
   Defense break: Inflict an additional 10% of the enemy's max HP as damage, and inflict 20 points of Bleeding on them.

Charge and inflict damage on enemies within a 6x1 range in front;
No defense break: 25% chance to trigger Vulnerable effect on the enemy (lasts for 1 action);
   Defense break: Inflict an additional 10% of the enemy's max HP as damage, and 50% chance to trigger Vulnerable effect on the enemy (lasts for 1 action).

Inflict damage on enemies within a semicircular range of 5 squares in front;
No defense break: Inflict an additional 20 points of Internal Injury on the enemy, and reduce their Qi by 100 points;
   Defense break: Inflict an additional 15% of the enemy's max HP as damage, inflict 40 points of Internal Injury on them, and reduce their Qi by 175 points.

Inflict damage on enemies within a 5x1 range in front;
Without breaking defense: 25% chance to trigger Cut tendon effect on enemy (lasts 1 action);
   Breaking defense: Inflict additional 10% of enemy's max HP as damage, 50% chance to trigger Cut tendon effect on enemy (lasts 1 action).

Inflict damage on enemies within a 5x1 range in front;
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 10% of enemy's max HP as damage.

Inflict damage on enemy within 1 square in front;
Without breaking defense: 25% chance to trigger Vulnerable effect on enemy (lasts 1 action);
   Breaking defense: Inflict additional 15% of male enemy's max HP as damage, 50% chance to trigger Vulnerable effect on enemy (lasts 1 action).

Inflict damage on enemies within a 4-square radius fan-shaped range in front;
Without breaking defense: Inflict additional 10 points of Internal Injury on enemy;
   Breaking defense: Inflict additional 10% of enemy's max HP as damage, and inflict 20 points of Internal Injury.

Inflict damage on enemies within a 3-square radius around self;
Without breaking defense: 25% chance to trigger Broken bone effect on enemy (lasts 1 action);
   Breaking defense: Inflict additional 10% of enemy's max HP as damage, 50% chance to trigger Broken bone effect on enemy (lasts 1 action).

Inflict damage on enemies within a 5x1 range in front;
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 10% of enemy's max HP as damage.

Inflict damage on enemies within a 3-square radius cross-shaped range around self;
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 10% of enemy's max HP as damage.

Inflict damage on enemies within a 4-square radius fan-shaped range in front;
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 10% of enemy's max HP as damage.

Inflict damage on enemies within a 5-square radius fan-shaped range in front, each enemy defeated in this combat increases damage by 10%, up to 100%.
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 20% of enemy's max HP as damage.

Inflict damage on enemies within a 5-square radius around self;
Without breaking defense: 35% chance to trigger Slumber effect on enemy (lasts 2 actions);
   Breaking defense: Inflict additional 20% of enemy's max HP as damage, 75% chance to trigger Slumber effect on enemy (lasts 2 actions).

Pull a character within a 6-square radius diamond-shaped range around self to the front, if it's an enemy, inflict additional damage, if it's an ally, they get 15% final damage reduction until their next action.
Without breaking defense: No additional effects;
   Breaking defense: Inflict additional 15% of enemy's max HP as damage.

Inflict damage on enemies within a 2-square radius around self and knock them back 1 square;
Without breaking defense: Reduce enemy's energy by 100 points;
   Breaking defense: Inflict additional 15% of enemy's max HP as damage, and reduce enemy's energy by 175 points.

Pull enemies within a radius of 7 squares to yourself and inflict damage, converting 10% of the damage dealt into your own HP.
Unbroken Defense: No additional effects;
   Broken Defense: Inflict an additional 20% of the enemy's maximum HP as damage.

Inflict damage on enemies within a radius of 5 squares around yourself;
Unbroken Defense: No additional effects;
   Broken Defense: For non-boss enemies lower than your own Level, there is a chance to trigger Instant death, the higher the Level difference, the higher the probability.

Inflict damage on enemies within a 5-grid radius of yourself;
If the defense is not broken: no additional effects;
If the defense is broken: inflict an additional 20% of the enemy's maximum HP in damage, and the next attack will definitely be critical and combo.

Inflict damage on enemies within a 5-grid radius of yourself;
If the defense is not broken: reduce the enemy's Defense by 8% (lasts for 2 actions).
If the defense is broken: inflict an additional 20% of the enemy's maximum HP in damage, and reduce the enemy's Defense by 15% (lasts for 3 actions).

Inflict damage on enemies within a 6-grid radius of yourself;
If the defense is not broken: reduce the enemy's Attack by 5% and Action Speed by 10% (lasts for 2 actions).
If the defense is broken: inflict an additional 15% of the enemy's maximum HP in damage (30% of the maximum HP for male enemies), and reduce the enemy's Attack by 8% and Action Speed by 15% (lasts for 2 actions).

Inflict damage on enemies within a radius of 5 squares of yourself and pull them to your side;
Unbroken Defense: No additional effects;
Broken Defense: Inflict additional damage equal to 25% of the enemy's maximum HP, and 25% of this percentage damage will be converted into your own HP; the enemy's current MP decreases by 10%; recover 10% of your own MP.
